(3332, 'en', 'wpcf', 'edfe171b68206fb8c03142356ed28246', 'Once you buy the full Toolset, you will be able to edit Views, CRED forms and Layouts in your site, as well as build new ones.', NULL, 'LINE', NULL, 0, '', '3fe56376f67658c809d9dd318fc3480e', NULL),
