(3335, 'en', 'wpcf', '0e1e6c616d06ed3f25e4b4436838bded', 'Do you have a minute to tell us why you''re removing Types?', NULL, 'LINE', NULL, 0, '', '4e9dc896873851277907d0c678a00cf8', NULL),
(3336, 'en', 'wpcf', '5f4f73010cc09b0d3c9cd3752272fdd5', 'Skip feedback', NULL, 'LINE', NULL, 0, '', 'fd6aec4e85042884c5dc9ef4ebe254f0', NULL),
(3383, 'en', 'default', 'e86c6f139efb799908dc085d7eef53ad', 'Press This', NULL, 'LINE', NULL, 0, '', '18541630a2cd7399da35feee874764b7', NULL),
(3384, 'en', 'default', '1c766f50588f8caada9b5d7130ab1127', 'Press This is a bookmarklet that makes it easy to blog about something you come across on the web. You can use it to just grab a link, or to post an excerpt. Press This will even allow you to choose from images included on the page and use them in your post. Just drag the Press This link on this screen to your bookmarks bar in your browser, and you&#8217;ll be on your way to easier content creation. Clicking on it while on another website opens a popup window with all these options.', NULL, 'LINE', NULL, 0, '', 'fe3bd540eb74778a598238b253f74c86', NULL),
(3385, 'en', 'default', 'c6448a2cdbc2074c41e2fe7249de1927', 'Categories and Tags Converter', NULL, 'LINE', NULL, 0, '', '40ef29ade9db93dd527862ec4b95c9e9', NULL),
(3386, 'en', 'default', 'b0ca6078939acc19b65f7d3a980a50ff', 'Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.', NULL, 'LINE', NULL, 0, '', 'e90a19994fd4faf5fab54f4358835df1', NULL),
(3387, 'en', 'default', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, 'LINE', NULL, 0, '', '73e9ba17e991f5898b5f2b0737c9ad4c', NULL),
(3388, 'en', 'default', 'fdb08da1ca19dfdbc05685ed83b1059d', '<a href="https://codex.wordpress.org/Tools_Screen">Documentation on Tools</a>', NULL, 'LINE', NULL, 0, '', 'f1411a4fea7d9379e0329d8e5ceee3ea', NULL),
(3389, 'en', 'default', '06c51163e8813283ab725e4dfd467183', 'Press This is a little tool that lets you grab bits of the web and create new posts with ease.', NULL, 'LINE', NULL, 0, '', '950810cab5d955bbb097b8fbf9beaa3a', NULL),
(3390, 'en', 'default', '21ca206e6734e57187cfc99edfa37548', 'Use Press This to clip text, images and videos from any web page. Then edit and add more straight from Press This before you save or publish it in a post on your site.', NULL, 'LINE', NULL, 0, '', '7d17dbbe8d42814301f7a0be3dd88d5c', NULL),
(3391, 'en', 'default', '51efd8b10052581de553d62d6d45aa5c', 'Install Press This', NULL, 'LINE', NULL, 0, '', '5b702ab015426c9473939f27ffc8efd6', NULL),
(3392, 'en', 'default', 'a67da649ec6dd243a001cf4e451ba5bd', 'Bookmarklet', NULL, 'LINE', NULL, 0, '', '8940620ef1f6607d183985520677250c', NULL),
(3393, 'en', 'default', 'f6c5cca10233a4c683fbd2254d733386', 'Drag the bookmarklet below to your bookmarks bar. Then, when you&#8217;re on a page you want to share, simply &#8220;press&#8221; it.', NULL, 'LINE', NULL, 0, '', '627ef8cf75e0fe5c16d66ce6efc68e82', NULL),
(3394, 'en', 'default', '22224c5b61347aed4da4d55fea064264', 'Copy &#8220;Press This&#8221; bookmarklet code', NULL, 'LINE', NULL, 0, '', 'ca60b65785eedc80e857bbeaca527e4c', NULL),
(3395, 'en', 'default', 'fd4eac813576d78a40efe097d3fe7b5a', 'If you can&#8217;t drag the bookmarklet to your bookmarks, copy the following code and create a new bookmark. Paste the code into the new bookmark&#8217;s URL field.', NULL, 'LINE', NULL, 0, '', '0c25eb55559fa3099edf02d76f1acafa', NULL),
(3396, 'en', 'default', 'c674d8933142c81e6344f9d0691b3e39', 'Direct link (best for mobile)', NULL, 'LINE', NULL, 0, '', 'dfc1ee84ef583a9d23ad6de1423fca5e', NULL),
(3397, 'en', 'default', '222d87486115ac59d13346325078d300', 'Follow the link to open Press This. Then add it to your device&#8217;s bookmarks or home screen.', NULL, 'LINE', NULL, 0, '', '81b06074340feb87da4102def8cc915f', NULL),
(3398, 'en', 'default', '91fd1e6cf55f79eb1a07557f281784b1', 'Open Press This', NULL, 'LINE', NULL, 0, '', '4d72c1440bcaa7fcd1dbba7df97c6560', NULL);
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `location`) VALUES
(3399, 'en', 'default', 'e8953b095643b4bf6a1cd0bae7a85508', 'If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.', NULL, 'LINE', NULL, 0, '', '194c0e92da833182de4233fc3786e2b7', NULL),
(3403, 'en', 'default', '52f4393e1b52ba63e27310ca92ba098c', 'General Settings', NULL, 'LINE', NULL, 0, '', 'a133f68ecc6a9bb928b4ba4d87153d5e', NULL),
(3404, 'en', 'default', '49eb6a44db57cba8d66b3404fa9f0ad4', 'Y-m-d H:i:s', NULL, 'LINE', NULL, 0, 'timezone date format', 'd26fb5550b496dbd22188d52f7b828ab', NULL),
(3405, 'en', 'default', '1283a7fcac8dc097b0875b6a7290af01', 'The fields on this screen determine some of the basics of your site setup.', NULL, 'LINE', NULL, 0, '', 'da995ca09f039985d226591412a088b0', NULL),
(3406, 'en', 'default', 'f5edc853e96c1ea8b465c7ab39769ca3', 'Most themes display the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. The tagline is also displayed by many themes.', NULL, 'LINE', NULL, 0, '', 'a516610b2a4c609cdd98fb0de2c64939', NULL),
(3407, 'en', 'default', '68804ce6aa38ab1ef7d4e33889033f7b', 'The WordPress URL and the Site URL can be the same (example.com) or different; for example, having the WordPress core files (example.com/wordpress) in a subdirectory instead of the root directory.', NULL, 'LINE', NULL, 0, '', '611f402fad36bf6c2938669e03586d18', NULL),
(3408, 'en', 'default', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', NULL, 'LINE', NULL, 0, '', '1e0104cd42ac1e2fe540ba466d5ff248', NULL),
(3409, 'en', 'default', '8f52d6a439157f46ebbd2782a6ce2a22', 'You can set the language, and the translation files will be automatically downloaded and installed (available if your filesystem is writable).', NULL, 'LINE', NULL, 0, '', '308e8d0b6f06c46087b020dda71cb159', NULL),
(3410, 'en', 'default', 'ae4787001faa3e6213de113c18805ee0', 'UTC means Coordinated Universal Time.', NULL, 'LINE', NULL, 0, '', 'a40d7f447f4e2af30c9f3120952b7948', NULL),
(3411, 'en', 'default', '84760e95a02e1b21fd067dcf8d357fdc', 'You must click the Save Changes button at the bottom of the screen for new settings to take effect.', NULL, 'LINE', NULL, 0, '', '40de51e1c0d646fdf0d7d9f4efaa3ea7', NULL),
(3412, 'en', 'default', '219049b8bddc1ddcb8b72d9d049546a4', '<a href="https://codex.wordpress.org/Settings_General_Screen">Documentation on General Settings</a>', NULL, 'LINE', NULL, 0, '', 'adeadeac86dd158f93fe5f16d5304cd9', NULL),
(3413, 'en', 'default', '1c30ff4da9d87eb559d726c72af85e2a', 'Site Title', NULL, 'LINE', NULL, 0, '', 'd2feb08f6116b0c68cf655fff51ab1d2', NULL),
