(4309, 'en', 'default', 'c0ed5e3f5e633991901390dd59336cc6', 'You can use the editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.', NULL, 'LINE', NULL, 0, '', 'f835ba39685bf5ad176052a11180bb18', NULL),
(4310, 'en', 'default', '8a65d903fd1c00d5917421ace60ab4a1', 'Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Don&#8217;t forget to save your changes (Update File) when you&#8217;re finished.', NULL, 'LINE', NULL, 0, '', 'd4d68515ec452eef50f486865b88f13d', NULL),
(4311, 'en', 'default', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, 'LINE', NULL, 0, '', 'f53280634c7e03c2413c208d3e3e68b2', NULL),
(4312, 'en', 'default', '398a09b4f2a68fcc14e71e5338621c16', 'In the editing area the Tab key enters a tab character. To move below this area by pressing Tab, press the Esc key followed by the Tab key. In some cases the Esc key will need to be pressed twice before the Tab key will allow you to continue.', NULL, 'LINE', NULL, 0, '', '9b72248ac990ee4079d76f2eec7faf79', NULL),
(4313, 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, 'LINE', NULL, 0, '', '8c4742c33256ee314435258e3a200070', NULL),
