(5644, 'en', 'twentyseventeen', '743c927423efa4c098b29c2f6928f5ae', 'Twenty Seventeen brings your site to life with header video and immersive featured images. With a focus on business sites, it features multiple sections on the front page as well as widgets, navigation and social menus, a logo, and more. Personalize its asymmetrical grid with a custom color scheme and showcase your multimedia content with post formats. Our default theme for 2017 works great in many languages, for any abilities, and on any device.', NULL, 'LINE', NULL, 0, '', 'ee36a08e3de486ffac7b4aceac971d2d', NULL),
(5645, 'en', 'twentyseventeen', 'd4e1a4dd93ef6a754d98f515dfbd1a7c', 'the WordPress team', NULL, 'LINE', NULL, 0, '', '69ef5518b4e315b570dc40aa8a96ee74', NULL),
