(5648, 'en', 'twentysixteen', '3ce63c9f05d4e065fc19c8fc20bcdee0', 'Twenty Sixteen is a modernized take on an ever-popular WordPress layout — the horizontal masthead with an optional right sidebar that works perfectly for blogs and websites. It has custom color options with beautiful default color schemes, a harmonious fluid grid using a mobile-first approach, and impeccable polish in every detail. Twenty Sixteen will make your WordPress look beautiful everywhere.', NULL, 'LINE', NULL, 0, '', '7ae8bc93894b434a09cbbdf7903ed490', NULL),
