(6315, 'en', 'default', '5f71bda8d746f5a38f8be090639b5e2f', 'Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.', NULL, 'LINE', NULL, 0, '', '2628ac04367ef5339322e23a38240fb5', NULL),
(6316, 'en', 'default', '554b7ac84f1fa573ee1867a3a2c02d09', 'The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.', NULL, 'LINE', NULL, 0, '', 'c870042c568c84af431c05479fe39260', NULL),
(6317, 'en', 'default', '0eaaeaef7c7f3164d2ece6ec88571c19', 'Removing and Reusing', NULL, 'LINE', NULL, 0, '', '449caefc4319d4e355a74cfbc0831768', NULL),
(6318, 'en', 'default', 'fc276f47f9e88e53fb9a81e0e683a057', 'If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.', NULL, 'LINE', NULL, 0, '', 'f5f6f5978f1a37ee120927289f3f6f8d', NULL),
(6319, 'en', 'default', '2a1b56a60634250cd6cf205c74ed00c6', 'Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.', NULL, 'LINE', NULL, 0, '', 'cb26d608dcaf5e53bfdccbb076ee7f6b', NULL),
(6320, 'en', 'default', 'c53d7d249deb2d1f0a9f4aedc03dd2c3', 'Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.', NULL, 'LINE', NULL, 0, '', 'ac9278c82439b66854fc13fb321c96e5', NULL),
(6321, 'en', 'default', '39379cb5216586c1e0bb31cd0dee64be', 'Missing Widgets', NULL, 'LINE', NULL, 0, '', 'fed26992edec9b0b4e080ce678b8e973', NULL),
(6322, 'en', 'default', '29c814f94f9655996c6982358d2d028f', 'Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.', NULL, 'LINE', NULL, 0, '', '90a9c622ce04410d1eb4367e50230adf', NULL),
(6323, 'en', 'default', '7703983ef109c52a423492c4bfa5ffbe', 'When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.', NULL, 'LINE', NULL, 0, '', 'a4018b4b9fa0ad74ac664770d4fa25bd', NULL),
(6324, 'en', 'default', '19f9d98856fa2fc85dd996d8834065a8', '<a href="https://codex.wordpress.org/Appearance_Widgets_Screen">Documentation on Widgets</a>', NULL, 'LINE', NULL, 0, '', '5f4aa7fdf5af3ac633eda848724fd1bb', NULL),
