";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:377:"Today we are happy to announce a few WPML compatible WooCommerce extensions. The WooCommerce extensions are: WooCommerce Fixed Quantity, Woo Product Remover, Advanced Flat Rate Shipping Method If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins Also, if [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Mohamed Khafaja";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4279:"<p><img class="aligncenter wp-image-1119587" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png" alt="compatible-woocommerce-extention-header-image" width="400" height="112" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png 568w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-150x42.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-300x84.png 300w" sizes="(max-width: 400px) 100vw, 400px" /><br />\nToday we are happy to announce a few WPML compatible WooCommerce extensions.</p>\n<p>The WooCommerce extensions are: <a href="https://wordpress.org/plugins/woocommerce-fixed-quantity/" target="_blank">WooCommerce Fixed Quantity</a>, <a href="https://wordpress.org/plugins/woo-product-remover/" target="_blank">Woo Product Remover</a>, <a href="https://store.multidots.com/advanced-flat-rate-shipping-method-for-woocommerce" target="_blank" rel="nofollow">Advanced Flat Rate Shipping Method</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and are ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class="feature">\n<h2 style="text-align: center;">WooCommerce Fixed Quantity</h2>\n<blockquote><p>Set the selling quantity for your products.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/woocommerce-fixed-quantity/" target="_blank">Download WooCommerce Fixed Quantity</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Woo Product Remover</h2>\n<blockquote><p>Woo Product Remover allows you to, via a single click, remove all woocommerce products from your site. It cleans up your database from products, their metadata, relationships, as well as product variations and their related meta data.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/woo-product-remover/" target="_blank">Download Woo Product Remover</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Advanced Flat Rate Shipping Method</h2>\n<blockquote><p>Advance Flat Rate Shipping Method For Woocommerce plugin allows you to create multiple custom flat rate shipping methods in WooCommerce.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://store.multidots.com/advanced-flat-rate-shipping-method-for-woocommerce" target="_blank" rel="nofollow">Purchase Advanced Flat Rate Shipping Method</a></p>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=JSQJKoTno_4:rFCPZ4DPqnY:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=JSQJKoTno_4:rFCPZ4DPqnY:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=JSQJKoTno_4:rFCPZ4DPqnY:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=JSQJKoTno_4:rFCPZ4DPqnY:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=JSQJKoTno_4:rFCPZ4DPqnY:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=JSQJKoTno_4:rFCPZ4DPqnY:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/JSQJKoTno_4" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:73:"https://wpml.org/2017/05/compatible-woocommerce-extensions-may-2017/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:68:"https://wpml.org/2017/05/compatible-woocommerce-extensions-may-2017/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:62:"MGS joins the list of WPML’s integrated translation services";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/IioeCFnk9n4/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:93:"https://wpml.org/2017/04/mgs-joins-the-list-of-wpmls-integrated-translation-services/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 26 Apr 2017 14:20:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1262360/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:410:"We are pleased to announce WPML’s recent integration with ManpowerGroup Solutions Language Services (MGS), a leading provider of language and content solutions. For the past 20 years, MGS has been providing high-quality localization services in more than 160 languages by creating and translating marketing and technical content, which is consistent and customized to specific brand designs. Tzvi [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Ornela Flores";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3932:"<p><span style="font-weight: 400;">We are pleased to announce </span><a href="https://wpml.org/"><span style="font-weight: 400;">WPML</span></a><span style="font-weight: 400;">’s recent integration with </span><a href="http://www.mgslanguage.com/" target="_blank" rel="noopener noreferrer"><span style="font-weight: 400;">ManpowerGroup Solutions Language Services</span></a><span style="font-weight: 400;"> (MGS), a leading provider of language and content solutions.</span></p>\n<p><a href="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlMGS.png"><img class="aligncenter wp-image-1262382" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlMGS-300x201.png" alt="" width="246" height="165" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlMGS-300x201.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlMGS-150x101.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlMGS.png 350w" sizes="(max-width: 246px) 100vw, 246px" /></a></p>\n<p>For the past 20 years, MGS has been providing high-quality localization services in more than 160 languages by creating and translating marketing and technical content, which is consistent and customized to specific brand designs.</p>\n<p><span style="font-weight: 400;">Tzvi Gordon, IT &amp; QA Manager at MGS Language Services says:</span></p>\n<blockquote><p><i><span style="font-weight: 400;">“To ensure that your website is suited to international markets, you need to adapt its content not only to another language, but to another business culture. The new text must fit the design and usability of your website, and graphics and interactive content must also be translated. This and much more will be delivered effortlessly and seamlessly with our new integration with WPML. Your WordPress website will be a sure success</span></i><span style="font-weight: 400;">.”</span></p></blockquote>\n<p><span style="font-weight: 400;">Its team of 1200 expert translation professionals can handle a vast range of jobs regardless of the size, location, or subject. MGS’ fields of expertise include telecom, automotive, IT, printing, medical devices, media, IM, enterprise applications and management, e-learning, and banking and finance, among others.</span></p>\n<p><span style="font-weight: 400;">The in-country translators of MGS are completely immersed in the local culture and have vast experience in maintaining the SEO of websites by producing guides and glossaries; localizing graphics elements, multimedia presentations, and flash and video components; and providing diligent website translation and copywriting when required.</span></p>\n<p>If you are an existing WPML user and are interested in using MGS for translation, follow the instructions for <a href="https://wpml.org/translation-service/mgs-translation-services/">translating <span style="font-weight: 400;">WordPress sites with MGS</span></a><span style="font-weight: 400;">. If you are new to WPML, feel free to purchase the</span><a href="https://wpml.org/purchase/"><span style="font-weight: 400;"> Multilingual CMS</span></a><span style="font-weight: 400;"> package and get started.</span></p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=IioeCFnk9n4:X3eUy3iUJOg:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=IioeCFnk9n4:X3eUy3iUJOg:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=IioeCFnk9n4:X3eUy3iUJOg:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=IioeCFnk9n4:X3eUy3iUJOg:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=IioeCFnk9n4:X3eUy3iUJOg:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=IioeCFnk9n4:X3eUy3iUJOg:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/IioeCFnk9n4" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:90:"https://wpml.org/2017/04/mgs-joins-the-list-of-wpmls-integrated-translation-services/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:85:"https://wpml.org/2017/04/mgs-joins-the-list-of-wpmls-integrated-translation-services/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:35:"WPML Compatible Themes – Apr 2017";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/sl7X1GVqq58/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:65:"https://wpml.org/2017/04/wpml-compatible-themes-apr-2017/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 25 Apr 2017 11:41:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:13:"Compatibility";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1261182/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:374:"Today we are happy to announce several WPML compatible themes. The themes are: Liber, Okab, Hodges, Simple &#038; Elegant, Comely, Gateway, PE Magnetic, OneMax, Newspaper, Pile, Ichiban, ConsultPress If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Mohamed Khafaja";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:8078:"<p><img class="aligncenter wp-image-975307" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-300x84.png" alt="WPML Compatible themes" width="400" height="112" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-300x84.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1-150x42.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/07/WPML-Compatible-themes-1.png 568w" sizes="(max-width: 400px) 100vw, 400px" /></p>\n<p>Today we are happy to announce several WPML compatible themes.</p>\n<p>The themes are: <a href="http://www.anarieldesign.com/themes/restaurant-bar-wordpress-theme/" target="_blank" rel="nofollow">Liber</a>, <a href="https://themeforest.net/item/okab-responsive-multipurpose-wordpress-theme/16958600" target="_blank">Okab</a>, <a href="https://themeforest.net/item/hodges-modern-business-corporate-multipurpose-wordpress-theme/19259532" target="_blank">Hodges</a>, <a href="https://themeforest.net/item/simple-elegant-multipurpose-theme/13730411" target="_blank">Simple &#038; Elegant</a>, <a href="https://themeforest.net/item/comely-creative-concept-theme/19404527" target="_blank">Comely</a>, <a href="https://wordpress.org/themes/gateway/" target="_blank">Gateway</a>, <a href="https://www.pixelemu.com/wordpress-themes/i/3-business/234-magnetic" target="_blank" rel="nofollow">PE Magnetic</a>, <a href="https://themeforest.net/item/onemax-responsive-multipurpose-wordpress-theme/19319314" target="_blank">OneMax</a>, <a href="https://themeforest.net/item/newspaper/5489609" target="_blank">Newspaper</a>, <a href="https://themeforest.net/item/pile-an-uncoventional-wordpress-portfolio-theme/8989183" target="_blank">Pile</a>, <a href="https://themeforest.net/item/ichiban-a-theme-for-photographers/10839660" target="_blank">Ichiban</a>, <a href="https://www.proteusthemes.com/wordpress-themes/consultpress/" target="_blank" rel="nofollow">ConsultPress</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class="feature">\n<h2 style="text-align: center;">Liber</h2>\n<blockquote><p>Liber is a  responsive WordPress theme optimized for restaurant and bar websites.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="http://www.anarieldesign.com/themes/restaurant-bar-wordpress-theme/" target="_blank" rel="nofollow">Purchase Liber</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Okab</h2>\n<blockquote><p>Okab is a fully responsive multipurpose WordPress theme.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/okab-responsive-multipurpose-wordpress-theme/16958600" target="_blank">Purchase Okab</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Hodges</h2>\n<blockquote><p>Hodges is a multi-purpose WordPress theme</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/hodges-modern-business-corporate-multipurpose-wordpress-theme/19259532" target="_blank">Purchase Hodges</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Simple &#038; Elegant</h2>\n<blockquote><p>Simple &#038; Elegant is a clean multi-purpose WordPress theme.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/simple-elegant-multipurpose-theme/13730411" target="_blank">Purchase Simple &#038; Elegant</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Comely</h2>\n<blockquote><p>Creative Concept WordPress  Theme</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/comely-creative-concept-theme/19404527" target="_blank">Purchase Comely</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Gateway</h2>\n<blockquote><p>Free fully customizable WordPress theme.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/themes/gateway/" target="_blank">Download Gateway</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">PE Magnetic</h2>\n<blockquote><p>Multipurpose business WordPress theme</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://www.pixelemu.com/wordpress-themes/i/3-business/234-magnetic" target="_blank" rel="nofollow">Purchase PE Magnetic</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">OneMax</h2>\n<blockquote><p>OneMax is a design studio that specializes in WordPress design for brands of all sizes</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/onemax-responsive-multipurpose-wordpress-theme/19319314" target="_blank">Purchase OneMax</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Newspaper</h2>\n<blockquote><p>Newspaper is a WordPress theme that lets you write articles and blog posts with ease.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/newspaper/5489609" target="_blank">Purchase Newspaper</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Pile</h2>\n<blockquote><p>PILE is a refined and flexible Portfolio WordPress theme.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/pile-an-uncoventional-wordpress-portfolio-theme/8989183" target="_blank">Purchase Pile</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Ichiban</h2>\n<blockquote><p>Ichiban is customizable WordPress theme suitable for portfolio sites.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/ichiban-a-theme-for-photographers/10839660" target="_blank">Purchase Ichiban</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">ConsultPress</h2>\n<blockquote><p>ConsultPress &#8211; WordPress Theme for Consulting and Financial Businesses.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://www.proteusthemes.com/wordpress-themes/consultpress/" target="_blank" rel="nofollow">Purchase ConsultPress</a></p>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=sl7X1GVqq58:Z-cV0Dfu3Yo:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=sl7X1GVqq58:Z-cV0Dfu3Yo:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sl7X1GVqq58:Z-cV0Dfu3Yo:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=sl7X1GVqq58:Z-cV0Dfu3Yo:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=sl7X1GVqq58:Z-cV0Dfu3Yo:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=sl7X1GVqq58:Z-cV0Dfu3Yo:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/sl7X1GVqq58" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:62:"https://wpml.org/2017/04/wpml-compatible-themes-apr-2017/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:57:"https://wpml.org/2017/04/wpml-compatible-themes-apr-2017/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:71:"Major improvement in the translation process between WPML 3.7 and Avada";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/SOkzy1ncPsc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:57:"https://wpml.org/2017/04/improvement-wpml-avada/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 25 Apr 2017 04:44:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1260236/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:310:"Did you know that WPML has been compatible with Avada since 2013? Let’s see what is changing with WPML 3.7 and how we save you precious time. Previously, to translate a page built with the Fusion Builder, you had to rebuild it for every language shown on your site. Four years later, it’s safe to [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:14:"Marine Larmier";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3297:"<p>Did you know that WPML has been compatible with Avada since 2013?<br />\nLet’s see what is changing with WPML 3.7 and how we save you precious time.</p>\n<p>Previously, to translate a page built with the Fusion Builder, you had to rebuild it for every language shown on your site. Four years later, it’s safe to say that we have reached a significant milestone when it comes to the translation process experience with Avada:</p>\n<ul>\n<li>Only the textual elements of the Design Elements are shown, making the translation process easier.</li>\n<li>Side-by-side view of these original textual Elements and their translations.</li>\n<li>No need to duplicate the page under each language.</li>\n</ul>\n<p>&nbsp;</p>\n<div id="attachment_1260255" style="width: 710px" class="wp-caption aligncenter"><img class="wp-image-1260255" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Avada-Translation-Editor-2-300x146.png" alt="Avada and WPML Translation Editor" width="700" height="341" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Avada-Translation-Editor-2-300x146.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Avada-Translation-Editor-2-150x73.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Avada-Translation-Editor-2-768x374.png 768w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Avada-Translation-Editor-2-1024x499.png 1024w" sizes="(max-width: 700px) 100vw, 700px" /><p class="wp-caption-text">Translating a page built with Avada using WPML Translation Editor</p></div>\n<p>&nbsp;</p>\n<p>It looks much more convenient, doesn’t it?</p>\n<p>Other good news is that it also works with Avada demo-content. All the text you create based on these demos will be shown in this Translation Editor too. This includes all custom post types from Avada such as the FAQ’s or Portfolio sections.</p>\n<p>Finally, check out the full documentation we wrote about <a href="https://wpml.org/documentation/theme-compatibility/using-wpml-with-the-avada-theme/">how to translate Avada using WPML</a>.</p>\n<h3>Get in touch with WPML</h3>\n<p>We have told you a lot about us, now it’s time to hear from you. Have you ever used WPML Translation Editor with Avada? Are you thinking about going multilingual?</p>\n<p>Use the comments section to share your projects and your thoughts. We are always happy to know more about you.</p>\n<p>For the newcomers, <a href="http://www.wpml.org/purchase">try WPML for 30 days</a>. If you don’t like it, let us know and we’ll promptly refund your order.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=SOkzy1ncPsc:LRjsN-tL5_0:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=SOkzy1ncPsc:LRjsN-tL5_0:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=SOkzy1ncPsc:LRjsN-tL5_0:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=SOkzy1ncPsc:LRjsN-tL5_0:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=SOkzy1ncPsc:LRjsN-tL5_0:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=SOkzy1ncPsc:LRjsN-tL5_0:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/SOkzy1ncPsc" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:53:"https://wpml.org/2017/04/improvement-wpml-avada/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"8";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:48:"https://wpml.org/2017/04/improvement-wpml-avada/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:46:"New integration available between WPML and GPI";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/GFIMvlrlGwA/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:80:"https://wpml.org/2017/04/new-integration-available-between-wpml-and-gpi/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 24 Apr 2017 12:51:39 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1260290/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:407:"We are happy to announce the recent integration between WPML and GPI, a leading translation agency. GPI (Globalization Partners International) was founded in 2001 by a team of language, technology, project management, and business professionals. Apart from working with over 4,200 translators and interpreters, GPI also has copywriters, web design and development specialists, localization project [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Ornela Flores";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3470:"<p>We are happy to announce the recent integration between <a href="https://wpml.org/">WPML</a> and <a href="http://www.globalizationpartners.com/" target="_blank" rel="noopener noreferrer">GPI</a>, a leading translation agency.</p>\n<p><a href="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlGPI.png"><img class="aligncenter size-medium wp-image-1260300" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlGPI-300x135.png" alt="" width="300" height="135" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlGPI-300x135.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlGPI-150x67.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlGPI.png 446w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>\n<p>GPI (Globalization Partners International) was founded in 2001 by a team of language, technology, project management, and business professionals.</p>\n<p>Apart from working with over 4,200 translators and interpreters, GPI also has copywriters, web design and development specialists, localization project managers, and engineers, all networked to assist clients with their website translation projects and any technical issues they may have beyond the translation task.</p>\n<p>As a member of <a href="https://www.gala-global.org/" target="_blank" rel="noopener noreferrer">GALA</a> (Globalization and Localization Association) and the <a href="https://www.atanet.org/" target="_blank" rel="noopener noreferrer">American Translators Association</a>, GPI currently supports over 100 languages and 100 disciplines, using technology as a tool to deliver quality service on a global basis.</p>\n<p>GPI offers 14 main steps to website localization:</p>\n<ul>\n<li>Review &amp; analysis of source website assets</li>\n<li>Best-practice multilingual workflow based on CMS</li>\n<li>Project kick-off</li>\n<li>Subject-matter training and research</li>\n<li>Content cultural-correctness assessment</li>\n<li>Glossary and style-guide development</li>\n<li>Search engine optimization – keyword research and localization</li>\n<li>Transcreation and copywriting</li>\n<li>Localization of any graphics</li>\n<li>Localization of any documents</li>\n<li>Localization of any multimedia</li>\n<li>Basic online quality-assurance and testing</li>\n<li>Search-engine marketing</li>\n<li>Launch language versions</li>\n</ul>\n<p>If you are already a WPML user and are interested in using GPI for translation, follow the instructions for<a href="https://wpml.org/translation-service/gpi/"> translating WordPress sites with GPI</a>. If you are new to WPML, feel free to purchase the <a href="https://wpml.org/purchase/">Multilingual CMS</a> package and get started.</p>\n<p>&nbsp;</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=GFIMvlrlGwA:jF-zb3ygdVo:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=GFIMvlrlGwA:jF-zb3ygdVo:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=GFIMvlrlGwA:jF-zb3ygdVo:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=GFIMvlrlGwA:jF-zb3ygdVo:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=GFIMvlrlGwA:jF-zb3ygdVo:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=GFIMvlrlGwA:jF-zb3ygdVo:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/GFIMvlrlGwA" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:77:"https://wpml.org/2017/04/new-integration-available-between-wpml-and-gpi/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:72:"https://wpml.org/2017/04/new-integration-available-between-wpml-and-gpi/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"WPML 3.7.0 Released with Big Improvements for Page Builders";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/WqexwYcnMdY/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:93:"https://wpml.org/2017/04/wpml-3-7-0-released-with-big-improvements-for-page-builders/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 18 Apr 2017 13:16:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"WPML versions";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1255996/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:366:"We just released WPML 3.7.0. This version focuses on making it easier to translate sites built with page builders. We wrote about the new features in detail in the WPML 3.7.0 beta announcement. To sum up, this version features: Ability to update page-builder designs without losing translated strings Automatic translation for links in page-builder designs [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:4:"Amir";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2375:"<p class="lead">We just released WPML 3.7.0. This version focuses on making it easier to translate sites built with page builders.</p>\n<p>We wrote about the new features in detail in the <a href="https://wpml.org/2017/03/wpml-3-7-beta-brings-major-improvements-for-page-builders/">WPML 3.7.0 beta announcement</a>. To sum up, this version features:</p>\n<ul>\n<li>Ability to update page-builder designs without losing translated strings</li>\n<li>Automatic translation for links in page-builder designs</li>\n<li>Support for Elementor page builder</li>\n<li>Copy-once feature for custom fields</li>\n</ul>\n<h2>Update your sites</h2>\n<p>As always, the easiest way to update WPML is automatically. For this, make sure to register your sites. Then, you will receive automatic updates through the WordPress admin. You can always download WPML manually from <a href="https://wpml.org/account/">your account</a>.</p>\n<p>There was a little glitch during the first 1/2 hour when WPML 3.7 was released. The ZIP file was missing an XML file needed for automatic updates. If you only got an update for WPML 3.7 but not for the rest of WPML&#8217;s components, please download WPML 3.7 manually from your account.</p>\n<h2>Coming next to WPML</h2>\n<p>We&#8217;re working on a major update for the Media Translation, but this will take us a bit more time to complete (scheduled for WPML 3.9).</p>\n<p>The next major release of WPML will include new features to help you achieve better translation. After all, you&#8217;re using WPML for multilingual sites, so the quality of the translations matters more than many other things. I&#8217;ll write a lot more about this when we&#8217;re ready.</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=WqexwYcnMdY:0HW0L7dTGcw:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=WqexwYcnMdY:0HW0L7dTGcw:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=WqexwYcnMdY:0HW0L7dTGcw:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=WqexwYcnMdY:0HW0L7dTGcw:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=WqexwYcnMdY:0HW0L7dTGcw:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=WqexwYcnMdY:0HW0L7dTGcw:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/WqexwYcnMdY" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:90:"https://wpml.org/2017/04/wpml-3-7-0-released-with-big-improvements-for-page-builders/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"dat