anager, Media File Renamer If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual Ready Plugins Also, if you’re a theme [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Mohamed Khafaja";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3959:"<p><img class="aligncenter wp-image-995848" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-300x90.png" alt="Compatible Plugins-Header" width="400" height="121" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-300x90.png 300w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header-150x45.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/08/Compatible-Plugins-Header.png 680w" sizes="(max-width: 400px) 100vw, 400px" /></p>\n<p>Today we are happy to announce a few WPML compatible plugins.</p>\n<p>The plugins are: <a href="https://wordpress.org/plugins/scripts-n-styles/" target="_blank">Scripts n Style</a>, <a href="https://wordpress.org/plugins/real-estate-manager/" target="_blank">Real Estate Manager</a>, <a href="https://wordpress.org/plugins/media-file-renamer/" target="_blank">Media File Renamer</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class="feature">\n<h2 style="text-align: center;">Scripts n Style</h2>\n<blockquote><p>This plugin allows Admin users the ability to add custom CSS and JavaScript directly into individual Post, Pages or any other registered custom post types.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/scripts-n-styles/" target="_blank">Download Scripts n Style</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Real Estate Manager</h2>\n<blockquote><p>Real Estate Manager gives you a complete solution to setup a management system of agents who can create and manage their properties.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/real-estate-manager/" target="_blank">Download Real Estate Manager</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Media File Renamer</h2>\n<blockquote><p>The Media File Renamer is a WordPress plugin that physically renames media files for a cleaner system and for a better SEO.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/media-file-renamer/" target="_blank">Download Media File Renamer</a></p>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=QPHzst3vqbw:BO0JOd3ZzIU:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=QPHzst3vqbw:BO0JOd3ZzIU:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=QPHzst3vqbw:BO0JOd3ZzIU:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=QPHzst3vqbw:BO0JOd3ZzIU:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=QPHzst3vqbw:BO0JOd3ZzIU:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=QPHzst3vqbw:BO0JOd3ZzIU:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/QPHzst3vqbw" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:58:"https://wpml.org/2017/04/compatible-plugins-apr-2017/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:53:"https://wpml.org/2017/04/compatible-plugins-apr-2017/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:50:"WPML welcomes Wordcraft as new translation partner";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/INVWnbBxOS8/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:84:"https://wpml.org/2017/04/wpml-welcomes-wordcraft-as-new-translation-partner/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 17 Apr 2017 21:01:30 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:1:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1255497/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:404:"We are happy to announce the recent integration of WPML and Wordcraft, a brand new localization service. Wordcraft specializes in complex multilingual solutions for a wide range of industries including engineering, automotive and logistics. Its clients range from innovative start-ups to global players. The main idea behind Wordcraft is to make localization efforts holistic for all clients, [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Ornela Flores";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3550:"<p><span style="font-weight: 400;">We are happy to announce the recent integration of </span><a href="https://wpml.org/"><span style="font-weight: 400;">WPML</span></a><span style="font-weight: 400;"> and </span><a href="http://wordcraft.cc/en/">W<span style="font-weight: 400;">ordcraft</span></a><span style="font-weight: 400;">, a brand new localization service.</span></p>\n<p><a href="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlwordcraft.png"><img class="aligncenter size-full wp-image-1255501" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlwordcraft.png" alt="" width="276" height="158" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlwordcraft.png 276w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/wpmlwordcraft-150x86.png 150w" sizes="(max-width: 276px) 100vw, 276px" /></a></p>\n<p><span style="font-weight: 400;">Wordcraft specializes in complex multilingual solutions for a wide range of industries including engineering, automotive and logistics. Its clients range from innovative start-ups to global players.</span></p>\n<p><span style="font-weight: 400;">The main idea behind Wordcraft is to make localization efforts holistic for all clients, by tailoring the entire process to fit their internal and external localization needs. All stakeholders collaborate using its SaaS driven technology, which increases quality, saves time, and reduces costs by eliminating all unnecessary admin tasks.</span></p>\n<blockquote><p><i><span style="font-weight: 400;">“The powerful combination of WordPress and Wordcraft’s translation and localization expertise means we can move faster and more successfully into new markets.”</span></i></p>\n<p><span style="font-weight: 400;">Jörg Wellner, CEO of Wellner GmbH</span></p></blockquote>\n<p><span style="font-weight: 400;">With a network of several hundred freelancers serving a wide variety of domains and languages, Wordcraft offers different options for translation and quality control.</span></p>\n<p><span style="font-weight: 400;">Nearly a dozen people work behind-the-scenes at Wordcraft. Its project managers are trained translators who supervise projects at all times and understand your requirements.</span></p>\n<p><span style="font-weight: 400;">If you are already a WPML user and are interested in using Wordcraft for translation, follow the instructions for </span><a href="https://wpml.org/translation-service/wordcraft/"><span style="font-weight: 400;">translating WordPress sites with Wordcraft</span></a><span style="font-weight: 400;">. If you are new to WPML, feel free to purchase the </span><a href="https://wpml.org/purchase/"><span style="font-weight: 400;">Multilingual CMS</span></a><span style="font-weight: 400;"> package and get started.</span></p>\n<p>&nbsp;</p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=INVWnbBxOS8:KtMrgnBa6sI:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=INVWnbBxOS8:KtMrgnBa6sI:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=INVWnbBxOS8:KtMrgnBa6sI:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=INVWnbBxOS8:KtMrgnBa6sI:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=INVWnbBxOS8:KtMrgnBa6sI:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=INVWnbBxOS8:KtMrgnBa6sI:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/INVWnbBxOS8" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:81:"https://wpml.org/2017/04/wpml-welcomes-wordcraft-as-new-translation-partner/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:76:"https://wpml.org/2017/04/wpml-welcomes-wordcraft-as-new-translation-partner/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"Compatible WPML themes supporting custom Visual Composer shortcodes";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/rutJzbGLsgc/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:101:"https://wpml.org/2017/04/compatible-wpml-themes-supporting-custom-visual-composer-shortcodes/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 13 Apr 2017 09:01:33 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:13:"Compatibility";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1252060/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:334:"WPML integration with the Visual Composer page builder simplifies the process of translating the pages built with it. All you need to do is design your page in one language then use WPML to translate the textual elements inside that page. The following screenshot illustrates how easy it is to translate your pages using the [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Mohamed Khafaja";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:8240:"<p>WPML integration with the Visual Composer page builder simplifies the process of translating the pages built with it. All you need to do is design your page in one language then use WPML to translate the textual elements inside that page. The following screenshot illustrates how easy it is to translate your pages using the <strong>Translation Editor</strong>.</p>\n<p><a href="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Translation-editor-screen.png"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Translation-editor-screen.png" alt="" width="700" height="554" class="aligncenter size-full wp-image-1252237" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Translation-editor-screen.png 700w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Translation-editor-screen-150x119.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/Translation-editor-screen-300x237.png 300w" sizes="(max-width: 700px) 100vw, 700px" /></a></p>\n<p>Visual Composer allows theme developers to add custom modules to it. These new modules expand the design options for building pages. The modules also generate custom shortcodes which are not added to the theme’s language configuration file. As a result, the textual elements inside these modules are not available for translation on the <strong>Translation Editor</strong> page.  </p>\n<p>We looked up the most popular themes used by our clients and it turns out that many of these themes come bundled with Visual Composer. We contacted the theme authors and suggested they add support for their custom Visual Composer modules. </p>\n<p>We are happy to announce themes that integrate their Visual Composer custom shortcodes with WPML.</p>\n<div class="feature">\n<h2 style="text-align: center;">BeTheme</h2>\n<blockquote><p>BeTheme is a multi-purpose WordPress theme. It features pre-made layouts, a variety of portfolio layouts,swipe technology, and more.</p></blockquote>\n<p><a href="https://themeforest.net/item/betheme-responsive-multipurpose-wordpress-theme/7758048" target="_blank" rel="nofollow"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/betheme.png" alt="" width="590" height="301" class="aligncenter size-full wp-image-1252103" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/betheme.png 590w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/betheme-150x77.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/betheme-300x153.png 300w" sizes="(max-width: 590px) 100vw, 590px" /></a></p>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/betheme-responsive-multipurpose-wordpress-theme/7758048" target="_blank" rel="nofollow">Purchase BeTheme</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Jupiter</h2>\n<blockquote><p>Jupiter is a WordPress theme for all kinds of businesses from corporations, shop owners and small businesses to startups, artists and bloggers.</p></blockquote>\n<p><a href="https://themeforest.net/item/jupiter-multipurpose-responsive-theme/5177775" target="_blank" rel="nofollow"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/jupiter-1.jpg" alt="" width="590" height="300" class="aligncenter size-full wp-image-1252078" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/jupiter-1.jpg 590w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/jupiter-1-150x76.jpg 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/jupiter-1-300x153.jpg 300w" sizes="(max-width: 590px) 100vw, 590px" /></a></p>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/jupiter-multipurpose-responsive-theme/5177775" target="_blank" rel="nofollow">Purchase Jupiter</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Karma</h2>\n<blockquote><p>Karma is a highly customizable multi-purpose WordPress theme that suits all sorts of websites: blogs, portfolios, personal or corporate business sites. </p></blockquote>\n<p><a href="https://themeforest.net/item/karma-responsive-wordpress-theme/168737" target="_blank" rel="nofollow"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/karma.jpg" alt="" width="590" height="300" class="aligncenter size-full wp-image-1252123" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/karma.jpg 590w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/karma-150x76.jpg 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/karma-300x153.jpg 300w" sizes="(max-width: 590px) 100vw, 590px" /></a></p>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/karma-responsive-wordpress-theme/168737" target="_blank" rel="nofollow">Purchase Karma</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Osmosis</h2>\n<blockquote><p>Osmosis is a WordPress multi-purpose theme that provides many design elements making the website buildein process easier.</p></blockquote>\n<p><a href="https://themeforest.net/item/osmosis-responsive-multipurpose-theme/9839949" target="_blank" rel="nofollow"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/osmosis.jpg" alt="" width="590" height="300" class="aligncenter size-full wp-image-1252225" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/osmosis.jpg 590w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/osmosis-150x76.jpg 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/osmosis-300x153.jpg 300w" sizes="(max-width: 590px) 100vw, 590px" /></a></p>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/osmosis-responsive-multipurpose-theme/9839949" target="_blank" rel="nofollow">Purchase Osmosis</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Lacuisine</h2>\n<blockquote><p>LaCuisine is a restauran, cafe and bar WordPress theme.Included demo data and the easy to use drag and drop page builder will help you to have ready website in few minutes.</p></blockquote>\n<p><a href="https://themeforest.net/item/lacuisine-restaurant-wordpress-theme/15209010" target="_blank" rel="nofollow"><img src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/lacuisine.jpg" alt="" width="590" height="300" class="aligncenter size-full wp-image-1252229" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/lacuisine.jpg 590w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/lacuisine-150x76.jpg 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2017/04/lacuisine-300x153.jpg 300w" sizes="(max-width: 590px) 100vw, 590px" /></a></p>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://themeforest.net/item/lacuisine-restaurant-wordpress-theme/15209010" target="_blank" rel="nofollow">Purchase Lacuisine</a></p>\n</div>\n<p>If you are using a theme that adds custom modules to Visual Composer, please refer your theme author to the detailed tutorial on <a href="https://wpml.org/documentation/support/wpml-integration-with-page-builders-that-use-shortcodes/">how to integrate page builder that uses shortcodes with WPML</a>.Theme authors are more than welcome to contact us if they need any help with the integration. </p>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=rutJzbGLsgc:fv95co3g1i8:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=rutJzbGLsgc:fv95co3g1i8:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=rutJzbGLsgc:fv95co3g1i8:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=rutJzbGLsgc:fv95co3g1i8:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=rutJzbGLsgc:fv95co3g1i8:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=rutJzbGLsgc:fv95co3g1i8:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/rutJzbGLsgc" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:98:"https://wpml.org/2017/04/compatible-wpml-themes-supporting-custom-visual-composer-shortcodes/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:93:"https://wpml.org/2017/04/compatible-wpml-themes-supporting-custom-visual-composer-shortcodes/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:6:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:46:"Compatible WooCommerce Extensions – Apr 2017";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpml/~3/4zcXuTc3N9g/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:76:"https://wpml.org/2017/04/compatible-woocommerce-extensions-apr-2017/#respond";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 11 Apr 2017 09:53:56 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:13:"Announcements";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:13:"Compatibility";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:28:"https://wpml.org/?p=1251880/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:396:"Today we are happy to announce a few WPML compatible WooCommerce extensions. The WooCommerce extensions are: WooCommerce Wholesale Prices Premium, WooCommerce Wholesale Order Form, WooCommerce Quick Buy, Conditional Woo Checkout Field If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here: Multilingual Ready Themes Multilingual [&#8230;]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:15:"Mohamed Khafaja";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:5004:"<p><img class="aligncenter wp-image-1119587" src="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png" alt="compatible-woocommerce-extention-header-image" width="400" height="112" srcset="https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image.png 568w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-150x42.png 150w, https://d2salfytceyqoe.cloudfront.net/wp-content/uploads/2016/10/Compatible-woocommerce-extention-header-image-300x84.png 300w" sizes="(max-width: 400px) 100vw, 400px" /><br />\nToday we are happy to announce a few WPML compatible WooCommerce extensions.</p>\n<p>The WooCommerce extensions are: <a href="https://wholesalesuiteplugin.com/product/woocommerce-wholesale-prices-premium/" target="_blank" rel="nofollow">WooCommerce Wholesale Prices Premium</a>,<a href="https://wholesalesuiteplugin.com/product/woocommerce-wholesale-order-form/" target="_blank" rel="nofollow"> WooCommerce Wholesale Order Form</a>, <a href="https://wordpress.org/plugins/woocommerce-quick-buy/" target="_blank">WooCommerce Quick Buy</a>, <a href="https://wordpress.org/plugins/conditional-woo-checkout-field/" target="_blank">Conditional Woo Checkout Field</a></p>\n<p>If you want to review the entire multilingual ready list of themes and plugins you are welcome to view it here:</p>\n<ul>\n<li><a href="https://wpml.org/documentation/theme-compatibility/">Multilingual Ready Themes</a></li>\n<li><a href="https://wpml.org/documentation/plugins-compatibility/">Multilingual Ready Plugins</a></li>\n</ul>\n<p>Also, if you’re a theme or a plugin author and you want to make it compatible with WPML, we welcome you and are ready to help: You are welcome to contact us at <a href="https://wpml.org/documentation/theme-compatibility/go-global-program/">go global program page</a>.</p>\n<p>In order to expedite the process, we strongly recommend that you test your theme or plugin with our <a href="https://wpml.org/documentation/support/achieving-wpml-compatibility-for-your-themes-and-plugins/">Achieving WPML compatibility for your themes and plugins</a>. It easily tests compatibility with WPML and helps you quickly make your theme or plugin Multilingual Ready.</p>\n<div class="feature">\n<h2 style="text-align: center;">WooCommerce Wholesale Prices Premium</h2>\n<blockquote><p>Easily set wholesale pricing for products, minimum purchase amounts, tiered discounts, control shipping and tax separately from retail customers</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wholesalesuiteplugin.com/product/woocommerce-wholesale-prices-premium/" target="_blank" rel="nofollow">Purchase WooCommerce Wholesale Prices Premium</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">WooCommerce Wholesale Order Form</h2>\n<blockquote><p>Responsive layout, fully AJAX enabled to avoid page reloading, searchable, categorizable.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wholesalesuiteplugin.com/product/woocommerce-wholesale-order-form/" target="_blank" rel="nofollow">Purchase WooCommerce Wholesale Order Form</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">WooCommerce Quick Buy</h2>\n<blockquote><p>Add Quick buy button to redirect user to checkout / cart immediately when he click quick buy button.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/woocommerce-quick-buy/" target="_blank">Download WooCommerce Quick Buy</a></p>\n</div>\n<div class="feature">\n<h2 style="text-align: center;">Conditional Woo Checkout Field</h2>\n<blockquote><p>If you sell a product through your WooCommerce store that requires you to collect some additional information from your customers before they complete their purchase, Conditional Woo Checkout Field will handel collecting all the information you need.</p></blockquote>\n<p style="text-align: center;"><a class="button download-button vt-p" href="https://wordpress.org/plugins/conditional-woo-checkout-field/" target="_blank">Download Conditional Woo Checkout Field</a></p>\n</div>\n<div class="feedflare">\n<a href="http://feeds.feedburner.com/~ff/wpml?a=4zcXuTc3N9g:BWxYdBNZ05A:D7DqB2pKExk"><img src="http://feeds.feedburner.com/~ff/wpml?i=4zcXuTc3N9g:BWxYdBNZ05A:D7DqB2pKExk" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=4zcXuTc3N9g:BWxYdBNZ05A:gIN9vFwOqvQ"><img src="http://feeds.feedburner.com/~ff/wpml?i=4zcXuTc3N9g:BWxYdBNZ05A:gIN9vFwOqvQ" border="0"></img></a> <a href="http://feeds.feedburner.com/~ff/wpml?a=4zcXuTc3N9g:BWxYdBNZ05A:V_sGLiPBpWU"><img src="http://feeds.feedburner.com/~ff/wpml?i=4zcXuTc3N9g:BWxYdBNZ05A:V_sGLiPBpWU" border="0"></img></a>\n</div><img src="http://feeds.feedburner.com/~r/wpml/~4/4zcXuTc3N9g" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:73:"https://wpml.org/2017/04/compatible-woocommerce-extensions-apr-2017/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:68:"https://wpml.org/2017/04/compatible-woocommerce-extensions-apr-2017/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:44:"http://purl.org/rss/1.0/modules/syndication/";a:2:{s:12:"updatePeriod";a:1:{i:0;a:5:{s:4:"data";s:6:"hourly";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:15:"updateFrequency";a:1:{i:0;a:5:{s:4:"data";s:1:"1";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explici