(435, '_transient_dash_f69de0bbfe7eaa113146875f40c02000', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/04/wordpress-4-7-4/''>WordPress 4.7.4 Maintenance Release</a> <span class="rss-date">20.04.2017</span><div class="rssSummary">After almost sixty million downloads of WordPress 4.7, we are pleased to announce the immediate availability of WordPress 4.7.4, a maintenance release. This release contains 47 bug fixes and enhancements, chief among them an incompatibility between the upcoming Chrome version and the visual editor, inconsistencies in media handling, and further improvements to the REST API.</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://ma.tt/2017/05/everything-is-hitched/''>Matt: Everything is Hitched</a></li><li><a class=''rsswidget'' href=''https://buddypress.org/2017/05/largest-turkish-recipe-site-spiced-up-with-buddypress/''>BuddyPress: Largest Turkish Recipe Site Spiced Up with BuddyPress</a></li><li><a class=''rsswidget'' href=''https://heropress.com/tomorrow-last-day-apply/''>HeroPress: TOMORROW is the last day to apply!</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> Jetpack by WordPress.com&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=jetpack&amp;_wpnonce=93040fa54b&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install Jetpack by WordPress.com">(Install)</a></li></ul></div>', 'no');
