(1, 1, '2017-04-28 21:50:46', '2017-04-28 18:50:46', 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', 'Привет, мир!', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2017-04-28 21:50:46', '2017-04-28 18:50:46', '', 0, 'http://rdteh.seotm.biz/?p=1', 0, 'post', '', 1),
(2, 1, '2017-04-28 21:50:46', '2017-04-28 18:50:46', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице «Детали» владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n<blockquote>Привет! Днём я курьер, а вечером — подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n...или так:\r\n<blockquote>Компания «Штучки XYZ» была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\nПерейдите <a href="http://rdteh.seotm.biz/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Главная', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2017-05-06 14:15:32', '2017-05-06 11:15:32', '', 0, 'http://rdteh.seotm.biz/?page_id=2', 0, 'page', '', 0),
