(34, 1, '2017-05-06 14:15:32', '2017-05-06 11:15:32', 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице «Детали» владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:\r\n<blockquote>Привет! Днём я курьер, а вечером — подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</blockquote>\r\n...или так:\r\n<blockquote>Компания «Штучки XYZ» была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</blockquote>\r\nПерейдите <a href="http://rdteh.seotm.biz/wp-admin/">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', 'Главная', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2017-05-06 14:15:32', '2017-05-06 11:15:32', '', 2, 'http://rdteh.seotm.biz/2017/05/06/2-revision-v1/', 0, 'revision', '', 0),
